import React from 'react';

const MainHeader = props => (
    <div className="row">
        <div className="twelve colums" style="text-align: center">
            <h1>Registra libros en tu libreria <strong>Pariental</strong></h1>
        </div>
    </div>
);

export default MainHeader;
